import { useState } from "react";

const Checklist = ({ onNext }) => {
  const [agreedToTerms, setAgreedToTerms] = useState(false);
  const [agreedToSharingData, setAgreedToSharingData] = useState(false);
  const allChecked = agreedToTerms && agreedToSharingData;

  const handleChange = (event) => {
    const { name, checked } = event.target;
    if (name === "terms") {
      setAgreedToTerms(checked);
    } else if (name === "sharingData") {
      setAgreedToSharingData(checked);
    }
  };

  const handleClick = () => {
    // do something when both items are checked
  };
  return (
    <div>
      <h1>Checklist</h1>
      <div>
        <label>
          <input
            type="checkbox"
            name="terms"
            checked={agreedToTerms}
            onChange={handleChange}
          />
          I agree to the terms and conditions.
        </label>
      </div>
      <div>
        <label>
          <input
            type="checkbox"
            name="sharingData"
            checked={agreedToSharingData}
            onChange={handleChange}
          />
          I agree with sharing my data.
        </label>
      </div>
      {allChecked && (
        <button onClick={handleClick}>Go to another page</button>
      )}
    </div>
  );
};

export default Checklist;
